  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Geological Survey Upper Midwest
  Environmental Sciences Center (UMESC) has produced a vegetation spatial database
  coverage (vegetation map) for the Effigy Mounds National Monument (EFMO) Vegetation
  Mapping Project, USGS-NPS Vegetation Mapping Program (VMP). The vegetation map shows
  the locations of National Vegetation Classification System (NVCS) plant communities
  (associations) at EFMO and immediate surroundings. Thematic accuracy requirements
  by the VMP specify 80% accuracy for map classes (themes) representing plant communities.
  During 2002, field classification data from 369 locations were collected at EFMO
  and nearby public lands for a thematic accuracy assessment (AA) to the vegetation
  map. The sites were randomly generated, stratified to map class themes representing
  National Vegetation Classification System (NVCS) natural/semi-natural plant communities
  using VMP standards. Of the 369 accuracy assessment sites collected, 34 sites representing
  NVCS Formation level types or open water were dropped to evaluate exclusively those
  map classes representing NVCS plant communities. Data from 335 sites were used in
  the final analysis. Regardless of their use in the analysis, all 369 AA sites are
  represented in the accuracy assessment site spatial database. The spatial database
  provides the locations of all AA sites along with results from the analysis.\",\n\t\"license_title\":
